eaw.Zone = function (myPath, myPaper, myName, defaultOwner){
  this.name = myName;
  this.axis_count = 0;
  this.ally_count = 0;
  this.russia_count = 0;
  //set the zone owner to the
  this.original_owner = defaultOwner;
  this.current_owner = defaultOwner;
  this.hoverin = function () {eaw.zonehoverinHandler(this);};
  this.hoverout = function () {eaw.zonehoveroutHandler(this);};
  this.el;
  eaw.GameElement.call(this, myPath, myPaper);
}
eaw.Zone.prototype = new eaw.GameElement();
eaw.Zone.prototype.constructor = eaw.Zone;
eaw.Zone.prototype.loadSaveGameZone = function(zone_model){
  this.name = zone_model.name;
  this.axis_count = zone_model.axis_count;
  this.ally_count = zone_model.ally_count;
  this.russia_count = zone_model.russia_count;
  //set the zone owner to the
  this.original_owner = zone_model.original_owner;
  this.current_owner = zone_model.current_owner;
}


eaw.Zone.prototype.checkContested = function(){
  //reset the zone then evaluate
  this.el.attr({stroke: 'black', 'stroke-width': 1});

  //are we contested?
  if (this.axis_count > 0 && (this.ally_count > 0 || this.russia_count > 0)){
    this.isContested = true;
    //show a contested zone
    this.el.attr({stroke: 'red', 'stroke-width': 6});
  }
  else {
    this.isContested = false;
  }
  return this.isContested;
};
//seazone is a type of zone
eaw.SeaZone = function (myPath, myPaper, myName, majorHarbor){
  this.major_harbor = majorHarbor;
  this.type = 'SeaZone';

  eaw.Zone.call(this, myPath, myPaper, myName, '');
}
eaw.SeaZone.prototype = Object.create(eaw.Zone.prototype);
eaw.SeaZone.prototype.constructor = eaw.SeaZone;
eaw.SeaZone.prototype.drawElement = function (){this.el = this.paper.path(this.pathstring).attr(
                                          {
                                            fill: this.paper.gradient('l(0,0,1,1)-#59ABC2-#4680A3'),
                                            stroke: 'black',
                                            'stroke-width': 2,
                                            'stroke-linejoin': 'round'
                                  }
                            );
                            this.el.data("Zone", this);
                            this.el.hover(this.hoverin, this.hoverout);
                      };
//landzone is a type of zone
eaw.LandZone = function (myPath, myPaper, myName, defaultOwner, hasFactory, pointValue){
  this.factory = hasFactory;
  this.point_value = pointValue;
  this.has_aa = '';
  this.type = 'LandZone';
  this.zone_gradient;
  this.gradient_string = 'l(0,0,1,1)-#C7C7C7-#ADADAD';
  switch (defaultOwner){
    case 'de':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#C7C7C7-#ADADAD');
    break;
    case 'uk':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#E6E5BE-#C8D19D');
    break;
    case '':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#FFA33B-#FF8800');
    break;
    case 'fr':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#526c7a-#64a0c1');
    break;
    case 'it':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#E3BB19-#EDD54E');
    break;
    case 'buffer':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#FFCEBA-#FFEBE3');
    break;
    case 'ru':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#632512-#A86C59');
    break;
    case 'fn':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#E3BB19-#EDD54E');
    break;
    case 'hu':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#E3BB19-#EDD54E');
    break;
    case 'bu':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#E3BB19-#EDD54E');
    break;
    case 'rm':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#E3BB19-#EDD54E');
    break;
    case 'na':
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#297A25-#22631F');
    break;
    default:
      this.zone_gradient = myPaper.gradient('l(0,0,1,1)-#FFA33B-#FF8800');
    break;
  }
  eaw.Zone.call(this, myPath, myPaper, myName, defaultOwner);
}
